import React from 'react';
import {Link} from 'react-router-dom'
const AdminItems = ({product}) => {
    return ( 
        <div className="  col-lg-3 col-sm-6 ">
        <div class="card-deck ">
  <div class="card">
  <img src={product.image.base64} class="card-img-top" alt="..."/>
    <div class="card-body">
      <h5 class="card-title">Product Id: {product._id}</h5>
      <h5 class="card-title">Price:{product.price}</h5>  
      
     
      
      <Link  className="btn btn-info rounded-pill">Edit</Link>
      <Link  className="btn btn-info rounded-pill">Del</Link>
    </div>
    
  </div>
  
</div>
</div>
    
    );
}
 
export default AdminItems
